"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[1477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/06/14/react-18.x","metadata":{"permalink":"/blog/2022/06/14/react-18.x","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-14-react-18.x.md","source":"@site/blog/2022-06-14-react-18.x.md","title":"react 18.x + eslint + prettier","description":"\uac70\uc758 3\ub144\ub9cc\uc5d0 \ub9ac\uc561\ud2b8\ub97c \ub2e4\uc2dc \ud574\ubcf4\ub124\uc694. \ub0af\uc124\uc5b4...","date":"2022-06-14T00:00:00.000Z","formattedDate":"2022\ub144 6\uc6d4 14\uc77c","tags":[{"label":"react","permalink":"/blog/tags/react"},{"label":"create-react-app","permalink":"/blog/tags/create-react-app"},{"label":"eslint","permalink":"/blog/tags/eslint"},{"label":"prettier","permalink":"/blog/tags/prettier"}],"readingTime":3.185,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"title":"react 18.x + eslint + prettier","authors":["green"],"tags":["react","create-react-app","eslint","prettier"]},"nextItem":{"title":"Reboot!","permalink":"/blog/reboot"}},"content":"\uac70\uc758 3\ub144\ub9cc\uc5d0 \ub9ac\uc561\ud2b8\ub97c \ub2e4\uc2dc \ud574\ubcf4\ub124\uc694. ~~\ub0af\uc124\uc5b4...~~\\n\\n# Installation\\n\ub290\ub08c\uc801\uc778 \ub290\ub08c\uc73c\ub85c, \ubb54\uac00 `App.js` \ub3c4 \uc5c4\uccad \uac04\ub2e8\ud574\uc9c4 \uac83 \uac19\uace0 \uc5ec\ub7ec\ubaa8\ub85c \ubc1c\uc804\ud55c \uac83 \uac19\ub124\uc694.\\n```bash\\nnpx create-react-app test\\n```\\n\ub85c `test` \ud504\ub85c\uc81d\ud2b8\ub97c \ud558\ub098 \ub9cc\ub4e4\uace0,\\n\\n```bash\\npnpm install\\n```\\n\uc124\uce58\ud574\uc694. \\n\\n:::info PNPM\\n\\n[pnpm](https://pnpm.io/) \uc740 \uc0c8\ub85c\uc6b4 \ud328\ud0a4\uc9c0 \ub9e4\ub2c8\uc800\uc778\ub370, \uc911\ubcf5 \ubaa8\ub4c8\ub4e4\uc744 \uc2ec\ubcfc\ub9ad \ub9c1\ud06c\ub85c \ucc98\ub9ac\ud558\ub294 \ub4f1\ub4f1\uc758 \uae30\ubc95\uc73c\ub85c \ubb34\uc9c4\uc7a5 \ube60\ub974\ub2e4\ub124\uc694.  \\n\uc2e4\uc81c \uccb4\uac10\uc18d\ub3c4\uac00 \ub9cc\uc871\uc2a4\ub7fd\uae34\ud574\uc694.\\n\\n:::\\n\\n# eslint\\n```bash\\nnpx eslint --init \\n```\\n\ucd08\uae30\ud654 \ud558\uba74,\\n```bash\\nYou can also run this command directly using \'npm init @eslint/config\'.\\nNeed to install the following packages:\\n  @eslint/create-config\\nOk to proceed? __(y)__\\n\u2714 How would you like to use ESLint? \xb7 problems\\n\u2714 What type of modules does your project use? \xb7 __esm__\\n\u2714 Which framework does your project use? \xb7 __react__\\n\u2714 Does your project use TypeScript? \xb7 __No__ / Yes\\n\u2714 Where does your code run? \xb7 __browser__\\n\u2714 What format do you want your config file to be in? \xb7 __JavaScript__\\nLocal ESLint installation not found.\\nThe config that you\'ve selected requires the following dependencies:\\n\\neslint-plugin-react@latest eslint@latest\\n\u2714 Would you like to install them now? \xb7 No / __Yes__\\n\u2714 Which package manager do you want to use? \xb7 __pnpm__\\n```\\n\uae30\ubcf8 \ubb3c\uc74c\uc5d0 \uc801\uc808\ud788 \ub300\ub2f5\uc744 \uc120\ud0dd\ud574\uc8fc\uba74 \ub418\uace0,  \\n\uadf8\ub7ec\uace0 \ub098\uba74 `.eslintrc.js` \uc774 \uc790\ub3d9 \uc0dd\uc131 \ub418\ub294\uad70\uc694.\\n\\n# prettier\\n```bash\\npnpm add -D prettier eslint-config-prettier eslint-plugin-prettier\\n```\\n\ud504\ub9ac\ud2f0\uc5b4 \uad00\ub828 \uc758\uc874\uc131\uc744 `devDependencies` \ub85c \ucd94\uac00\ud558\uba74 \ub418\uaca0\ub124\uc694.\\n\\n## .eslintrc.js\\n\ud504\ub9ac\ud2f0\uc5b4 \uc124\uc815\uc744 \ucd94\uac00\ud574\uc11c eslint \uc640 \uc798 \uc5b4\uc6b0\ub7ec\uc9c0\uac8c \ud558\ub294\uac8c\\n```js title=\\".eslintrc.js\\"\\nmodule.exports = {\\n  env: {\\n    browser: true,\\n    es2021: true,\\n  },\\n  extends: [\\n    \'eslint:recommended\',\\n    \'plugin:react/recommended\',\\n    \'plugin:prettier/recommended\', // \ucd94\uac00\\n  ],\\n  parserOptions: {\\n    ecmaFeatures: {\\n      jsx: true,\\n    },\\n    ecmaVersion: \'latest\',\\n    sourceType: \'module\',\\n  },\\n  plugins: [\'react\'],\\n  rules: {\\n    \'prettier/prettier\': \'error\', // \ucd94\uac00\\n  },\\n}\\n```\\n**\ucd94\uac00** \uc8fc\uc11d\ub41c \ubd80\ubd84\uc744 \uc0c8\ub86d\uac8c \ub123\uc5b4\uc8fc\ub294 \uac70\uc5d0\uc694. eslint \ud50c\ub7ec\uadf8\uc778\uc73c\ub85c \ub4f1\ub85d\ud558\uace0, `rules` \ud56d\ubaa9\uc740 \ud504\ub9ac\ud2f0\uc5b4 \uaddc\uce59 \uc704\ubc18\ud558\uba74 `error` \uac00 \ub358\uc838\uc9c0\ub2c8\uae4c \ucef4\ud30c\uc77c\uc774 \uc548\ub3fc\uc11c \uc9c4\ud589\uc774 \uc548\ub418\uaca0\ub124\uc694.\\n\\n# .prettierrc.js\\n\ud504\ub9ac\ud2f0\uc5b4 \uc635\uc158\uc740 `.prettierrc.js` \ud30c\uc77c\ub85c \uc9c4\ud589\ud558\uba74 \ub3fc\uc694.  \\n`package.json` \uc774 \uc788\ub294 \ub8e8\ud2b8 \ub514\ub809\ud1a0\ub9ac\uc5d0 \ud30c\uc77c\uc744 \ub9cc\ub4e4\uc5b4\uc11c,\\n```js title=\\".prettierrc.js\\"\\nmodule.exports = {\\n  arrowParens: \'avoid\',\\n  semi: false,\\n  singleQuote: true,\\n  trailingComma: \'none\'\\n}\\n```\\n\ubcc0\uacbd\ud558\ub294 \uc124\uc815\ub4e4\uc744 \ub123\uc5b4\uc918\uc694.  \\n\\n:::tip Prettier Options\\n\ubaa8\ub4e0 \uc635\uc158\uc5d0 \ub300\ud55c \uc124\uba85\uc740 [https://prettier.io/docs/en/options.html](https://prettier.io/docs/en/options.html) \uc5d0\uc11c \ud655\uc778\ud558\uc138\uc694.\\n:::\\n\\n\uc774\ub807\uac8c \ud55c \ud6c4\uc5d0 IDE \uc5d0\uc11c \ud504\ub9ac\ud2f0\uc5b4 \uc2e4\ud589\ud558\ub294 \ubc29\ubc95\ub3c4 \uc788\uc9c0\ub9cc\\n```bash\\nprettier .\\n```\\nCLI \uc5d0\uc11c \uc2e4\ud589\ud558\uba74, \ubaa8\ub4e0 \ud30c\uc77c\ub4e4\uc774 \ud55c\ubc29\uc5d0 \ud504\ub9ac\ud2f0\uc5b4 \uc124\uc815\uc73c\ub85c \ud3ec\ub9f7\ud305\uc774 \ub418\ub124\uc694.\\n\\n## .prettierignore\\ngit \uc758 tracking \uc744 \ud68c\ud53c\ud558\ub294 \uac83\uacfc \ub611\uac19\uc774 `.prettierignore` \uac00 \uc788\uc5b4\uc11c \ud504\ub9ac\ud2f0\uc5b4\ub97c \ud68c\ud53c\ud560 \uc218 \uc788\uc5b4\uc694."},{"id":"reboot","metadata":{"permalink":"/blog/reboot","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-14-welcome/index.md","source":"@site/blog/2022-06-14-welcome/index.md","title":"Reboot!","description":"\ubb54\uac00 \ub2e4\uc2dc \uc5f4\uc2ec\ud788 \uc2dc\uc791\ud574 \ubd05\ub2c8\ub2f9!","date":"2022-06-14T00:00:00.000Z","formattedDate":"2022\ub144 6\uc6d4 14\uc77c","tags":[{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.28,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"slug":"reboot","title":"Reboot!","authors":["green"],"tags":["hello","docusaurus"]},"prevItem":{"title":"react 18.x + eslint + prettier","permalink":"/blog/2022/06/14/react-18.x"},"nextItem":{"title":"JSX(in typescript) \uc0ac\uc6a9\ud558\uae30","permalink":"/blog/2019/08/06/JSX-in-typescript"}},"content":"\ubb54\uac00 \ub2e4\uc2dc \uc5f4\uc2ec\ud788 \uc2dc\uc791\ud574 \ubd05\ub2c8\ub2f9!\\n\\n:::danger \ub9dd\ud568\\n\\n\uc774\uc804 \ud3ec\uc2a4\ud305\ub3c4 \ubcc4\uac74 \uc5c6\uc5c8\uc9c0\ub9cc... \uae43\ud5d9 SSH \ubb38\uc81c\ub85c \uc774\ub9ac\uc800\ub9ac \ub3cc\ub9ac\ub2e4\uac00 \ub0a0\ub824\uba39\uc5c8\ub124\uc694.  \\n\uadf8\uc800 \uc6c3\uc9c0\uc694~ \ud83e\udd24\\n\\n:::\\n\\n![reboot](./mishmash.jpeg)"},{"id":"/2019/08/06/JSX-in-typescript","metadata":{"permalink":"/blog/2019/08/06/JSX-in-typescript","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-08-06-JSX-in-typescript.md","source":"@site/blog/2019-08-06-JSX-in-typescript.md","title":"JSX(in typescript) \uc0ac\uc6a9\ud558\uae30","description":"\uac1c\uc694","date":"2019-08-06T22:00:00.000Z","formattedDate":"2019\ub144 8\uc6d4 6\uc77c","tags":[{"label":"JSX","permalink":"/blog/tags/jsx"},{"label":"typescript","permalink":"/blog/tags/typescript"}],"readingTime":3.305,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"JSX(in typescript) \uc0ac\uc6a9\ud558\uae30","date":"2019-08-06T22:00","tags":["JSX","typescript"]},"prevItem":{"title":"Reboot!","permalink":"/blog/reboot"},"nextItem":{"title":"DOM \uc694\uc18c\uc758 \ud654\uba74 \uc704\uce58 \uad6c\ud558\uae30 Element.getBoundingClientRect() \ub97c \uc544\uc2dc\ub098\uc694?","permalink":"/blog/2019/07/16/getBoundingClientRect"}},"content":"### \uac1c\uc694\\n\uc2e4\ubb34\uc5d0\uc11c SPA\ub85c \uad6c\ud604\ud560 \uc218 \uc5c6\ub294 \uc774\uc0c1\ud55c(?) \uad6c\uc870\uc758 \uc6f9\uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uac1c\ubc1c\ud558\ub294\uac8c \ub2e4\ubc18\uc0ac\uac00 \ub418\uc5c8\uc5b4\uc694. \uace0\uac1d\uc0ac\ub294 \ud55c\ubc88 \ucc44\ud0dd\ud55c \uadf8 \ubcf5\uc7a1\ud558\uace0\ub3c4 \uc5b4\uc9c0\ub7ec\uc6b4 UI\ub97c \ub9d8\uc5d0 \ub4e4\uc5b4\ud55c \ud6c4\ub85c \uacc4\uc18d \uadf8\ub7f0\uc2dd\uc744 \uace0\uc218\ud558\uace0 \uc788\uac70\ub4e0\uc694.\\n\\n\uadf8\ub798\uc11c \ub9ac\uc5d1\ud2b8\ub97c \uc0ac\uc6a9\ud574\uc11c \uac1c\ubc1c\ud558\ub358 \uc5b4\ub5a4 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc870\uae08 \ub354 \ubc94\uc6a9\uc801\uc73c\ub85c(vanilla js) \uc0ac\uc6a9\ud574\ubcf4\ub824\uace0 \uc2dc\ub3c4 \ud558\uba74\uc11c DOM\uc744 \uc870\uc791\ud558\ub294 \ube44\ud6a8\uc728\uc801\uc778 Javascript WebAPI\uc5d0\uc11c \ud0c8\ud53c\ud558\uace0 JSX\ub97c \ub9ac\uc5d1\ud2b8 \uc5c6\uc774 \uc0ac\uc6a9\ud574\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\\n### \uc124\uc815\\n\uc6b0\uc120 `tsconfig.json` \uc5d0\uc11c,\\n```json\\n{\\n  \\"compilerOptions\\": {\\n    \\"module\\": \\"es6\\",\\n    \\"jsx\\": \\"react\\",\\n    \\"jsxFactory\\": \\"JSX\\",\\n    ...\\n```\\n`jsFactory` \ub85c `JSX` \ub77c\uace0 \ud588\uc73c\ub2c8, \uadf8 \uc774\ub984\uc73c\ub85c \uc804\uc5ed \ud568\uc218\ub97c \ub9cc\ub4e4\uc5b4\uc918\uc57c \ud574\uc694.\\n\\n```typescript\\nexport default function JSX(\\n  element: any,\\n  props: { [id: string]: any },\\n  ...children: any[]\\n): any {\\n  console.log(arguments) // \ud638\ucd9c\uc2dc\uc810, \uc778\uc790 \ud655\uc778\uc6a9\\n\\n  if (typeof element === \'function\')\\n    return element()\\n  else return {\\n    name: element,\\n    props,\\n    children\\n  }\\n}\\n```\\n\uc774\ub807\uac8c \ud574\uc11c `console.log` \ub4f1\uc73c\ub85c \ud568\uc218\uc758 \uc778\uc790, \ud638\ucd9c\uc2dc\uc810\uc744 \ud655\uc778\ud574 \ubcf4\uba74 JSX\uc758 DOM\uc774 \ud30c\uc2f1\ub418\ub294 \uacfc\uc815\uc744 \ud655\uc778 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n### \uad6c\ud604\\n\\n\ub9ac\uc5d1\ud2b8 \uad6c\ud604 \ucf54\ub4dc\ub97c \uc2e4\uc81c\ub85c \ubcf4\uc2dc\uba74 \ub354 \uc790\uc5f0\uc2a4\ub808 \uc774\ud574\uac00 \ub418\uc2e4\uac70\uc5d0\uc694.  \\n\uc81c\uac00 \uc0ac\uc6a9\ud55c \ucf54\ub4dc\ub294 \ub2e4\uc74c\uacfc \uac19\uc544\uc694.\\n\\n#### `JSX.ts` \ud30c\uc77c\\n```typescript\\nexport default function JSX(\\n  element: any,\\n  props: { [id: string]: any },\\n  ...children: any[]\\n): any {\\n  if (typeof element === \'function\')\\n    return element()\\n  else return {\\n    name: element,\\n    props,\\n    children\\n  }\\n}\\n\\nexport function dom(element: {\\n                      name: string,\\n                      props: { [id: string]: any },\\n                      children: any[]\\n                    },\\n                    parent: Node): void {\\n\\n  const tag: HTMLElement = document.createElement(element.name)\\n  attributes(tag, element.props)\\n\\n  if (element.children && element.children.length) {\\n    element.children.forEach(child => {\\n      if (typeof child !== \'object\' || !child.hasOwnProperty(\'name\'))\\n        tag.appendChild(document.createTextNode(child.toString()))\\n      else {\\n        child.props.__child = true\\n        dom(child, tag)\\n      }\\n    })\\n  }\\n\\n  parent.appendChild(tag)\\n}\\n```\\n\\n#### `index.tsx` \ud30c\uc77c\\n```tsx\\nimport JSX, {dom} from \\"./JSX\\"\\n\\ndom(\\n  <div>\\n    <h1>Hi, guys!</h1>\\n    <blockquote>\\n      Nice to see you!\\n      <strong>I tidy up my article.</strong>\\n      but, you will be boring.\\n    </blockquote>\\n    <p>Bye guys.</p>\\n  </div>\\n  ,\\n  document.querySelector(\'#app\')\\n)\\n\\n```\\n\\n### \ub9c8\ubb34\ub9ac\\n\uc774\uac8c \ud1b5\uc0c1\uc801\uc778 JSX \uc0ac\uc6a9\ubc95\uc778\uc9c0\ub294 \uc798 \ubaa8\ub974\uaca0\uc5b4\uc694. \uc5ec\ub984\ud734\uac00\ub97c \uae38\uac8c \ub2e4\ub140\uc654\ub294\ub370, \uadf8\uc804\uc5d0 \uac80\uc0c9\ud558\uace0 \ubc29\ubc95\uc744 \ucc3e\uc544\ubcf8\uac78 \uc774\uc81c\uc57c \uc815\ub9ac\ud558\ub2e4\ubcf4\ub2c8 \uc2e4\ud589\uc740 \uc798 \ub418\ub294\ub370 \ud655\uc2e0\uc740 \uac00\uc9c0 \uc54a\ub294\uad70\uc694.\\n\\n>\uc774\ub807\uac8c \uae30\ub85d\uc744 \ub0a8\uae34\ub2e4\ub294\uac8c \ubd80\ub044\ub7fd\uae30\ub3c4 \ud558\uace0, \ub3d9\uc2dc\uc5d0 \uc774\ub7f0 \ubc29\uc810\uc5c6\ub294 \uc5b4\uc815\uc815\ud55c \uc815\ubcf4\uac00 \uc5ec\ub7ec\uc0ac\ub78c\uc5d0\uac8c \uc624\ud574\ub97c \ub9cc\ub4dc\ub294\uac74 \uc544\ub2d0\uae4c\ud558\ub294 \ub51c\ub808\ub9c8\ub85c \ud3ec\uc2a4\ud305\uc744 \ud558\ub294\uac8c \ud56d\uc0c1 \ub450\ub824\uc6cc\uc694.  \\n>\uadf8\ub7ec\uba74\uc11c\ub3c4 \ud639\uc2dc \ub204\uad70\uac00, \uc5b4\ub460\uc18d\uc744 \ud5e4\ub9e4\ub294 \ub9c9\ub9c9\ud55c \uc774\uc5d0\uac8c \ubbf8\uc57d\ud558\ub098\ub9c8 \uc791\uc740 \ub4f1\ubd88\uc774\ub77c\ub3c4 \ub418\uc5c8\uc73c\uba74\ud558\ub294 \ubc14\ub78c\uc73c\ub85c \uc6a9\uae30\ub97c \ub0b4\uc5b4\uc694."},{"id":"/2019/07/16/getBoundingClientRect","metadata":{"permalink":"/blog/2019/07/16/getBoundingClientRect","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-07-16-getBoundingClientRect.md","source":"@site/blog/2019-07-16-getBoundingClientRect.md","title":"DOM \uc694\uc18c\uc758 \ud654\uba74 \uc704\uce58 \uad6c\ud558\uae30 Element.getBoundingClientRect() \ub97c \uc544\uc2dc\ub098\uc694?","description":"\uac1c\uc694","date":"2019-07-16T16:00:00.000Z","formattedDate":"2019\ub144 7\uc6d4 16\uc77c","tags":[{"label":"WebAPI","permalink":"/blog/tags/web-api"},{"label":"javascript","permalink":"/blog/tags/javascript"}],"readingTime":1.445,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"DOM \uc694\uc18c\uc758 \ud654\uba74 \uc704\uce58 \uad6c\ud558\uae30 Element.getBoundingClientRect() \ub97c \uc544\uc2dc\ub098\uc694?","date":"2019-07-16T16:00","tags":["WebAPI","javascript"]},"prevItem":{"title":"JSX(in typescript) \uc0ac\uc6a9\ud558\uae30","permalink":"/blog/2019/08/06/JSX-in-typescript"},"nextItem":{"title":"create-react-app v2(with typescript)\uc5d0\uc11c Sass \uc0ac\uc6a9\uc774 \uc26c\uc6cc\uc84c\uc5b4\uc694","permalink":"/blog/2019/07/10/create-react-app-sass"}},"content":"### \uac1c\uc694\\n\ud1a0\uc774\ud504\ub85c\uc81d\ud2b8\ub97c \uc9c4\ud589\ud558\ub358 \uc911, \ub9c8\uc6b0\uc2a4 \ud3ec\uc778\ud130\uc758 \uc88c\ud45c\uc640 \ub300\uc0c1 \uc694\uc18c\uc758 \uc704\uce58\ub97c \ube44\uad50\ud558\ub294 \uacc4\uc0b0\uc774 \ud544\uc694\ud55c \uc9c0\uc810\uc774 \uc0dd\uacbc\uc5b4\uc694.\\n\\n[jQuery.position()](https://api.jquery.com/position/) \uc774 \uc0dd\uac01\ub098\uc11c jQuery \ub97c \uc758\uc874\uc131 \uc8fc\uc785\ud574\uc57c\ud558\ub098 \uace0\ubbfc\ud558\ub2e4\uac00(~~\uc694\uc998\uc740 jQuery\ub97c \uc758\uc2dd\uc801\uc73c\ub85c \uac70\ubd80\ud558\uace0 \uc788\uc5b4\uc11c~~)  \\n\uc0c8\ub85c\uc6b4 API\ub97c \uc54c\uac8c \ub418\uc5c8\uc5b4\uc694.\\n\\n### \ud65c\uc6a9\\n[`Element.getBoundingClientRect()`](https://developer.mozilla.org/en-US/docs/Web/API/Element/getBoundingClientRect) \uc774 \ub140\uc11d \uc785\ub2c8\ub2e4. \uc2e4\ubb34\uc5d0\uc11c\ub294 \uace0\uac1d\ub300\uc751 \ub54c\ubb38\uc5d0 \uc544\uc9c1\ub3c4 IE10 \uc744 \uace0\ub824\ud574\uc57c\ud558\ub294\ub370, \uc774 API\ub294 IE9 \ubd80\ud130 \uc0ac\uc6a9\uac00\ub2a5\ud558\ub2e4\uace0 \ud558\ub124\uc694. (\uadf8\ud1a0\ub85d \uc624\ub7ab\ub3d9\uc548 \ubaa8\ub974\uace0 \uc788\uc5c8\ub2e4\ub2c8...)\\n\\n![](../static/files/20190716/scr.png)\\n\\n\uc2e4\ubb34\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 IE10 \uc5d0\uc11c \uc0ac\uc6a9\ud574 \ubcf4\uc558\uc2b5\ub2c8\ub2e4.\\n\\n### \ub9c8\ubb34\ub9ac\\njQuery\ub294 \uc4f0\uae30 \uc2eb\uace0 \uc9c1\uc811 \uc694\uc18c\uc758 \ubd80\ubaa8\ub97c \ucc3e\uc544 `html` \uae4c\uc9c0 \uc62c\ub77c\uac00\uba74\uc11c padding, margin, position \uc744 \uc870\uc0ac\ud558\uba74\uc11c \uc704\uce58\ub97c \uacc4\uc0b0\ud574\uc57c \ud558\ub294\uac74\uac00 \uc2f6\uc5c8\ub294\ub370, \uc88b\uc740 \ubc29\ubc95\uc744 \ucc3e\uc558\uc2b5\ub2c8\ub2e4.\\n\\n\ud55c\ud3b8\uc73c\ub85c\ub294 \uc774 \uc720\uc6a9\ud55c \uac83\uc744 \uc9c0\uae08\uae4c\uc9c0 \uc65c \ubaa8\ub974\uace0 \uc788\uc5c8\ub098 \uc2f6\uc5b4\uc11c \ubd80\uc871\ud55c \ub098\ub97c \uc790\ucc45\ud574 \ubd05\ub2c8\ub2e4. (\uc5b4\uca0c\ub4e0 \uadf8\ub798\ub3c4 Love myself :)"},{"id":"/2019/07/10/create-react-app-sass","metadata":{"permalink":"/blog/2019/07/10/create-react-app-sass","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-07-10-create-react-app-sass.md","source":"@site/blog/2019-07-10-create-react-app-sass.md","title":"create-react-app v2(with typescript)\uc5d0\uc11c Sass \uc0ac\uc6a9\uc774 \uc26c\uc6cc\uc84c\uc5b4\uc694","description":"typescript\ub85c \uac04\ub2e8\ud55c React \ubaa8\ub4c8\uc744 \uac1c\ubc1c\ud558\ub2e4\uac00 \ud654\uba74 \uad6c\uc131\uc774 \ud544\uc694\ud574\uc11c Sass\ub97c \uc0ac\uc6a9\ud558\ub824\ub2e4\uac00 \uc54c\uac8c \ub410\uc5b4\uc694.","date":"2019-07-10T10:00:00.000Z","formattedDate":"2019\ub144 7\uc6d4 10\uc77c","tags":[{"label":"sass","permalink":"/blog/tags/sass"},{"label":"react","permalink":"/blog/tags/react"},{"label":"typescript","permalink":"/blog/tags/typescript"}],"readingTime":0.735,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"create-react-app v2(with typescript)\uc5d0\uc11c Sass \uc0ac\uc6a9\uc774 \uc26c\uc6cc\uc84c\uc5b4\uc694","date":"2019-07-10T10:00","tags":["sass","react","typescript"]},"prevItem":{"title":"DOM \uc694\uc18c\uc758 \ud654\uba74 \uc704\uce58 \uad6c\ud558\uae30 Element.getBoundingClientRect() \ub97c \uc544\uc2dc\ub098\uc694?","permalink":"/blog/2019/07/16/getBoundingClientRect"},"nextItem":{"title":"JMH(Java Measurement Harness) \ubca4\uce58\ub9c8\ud0b9 \ud14c\uc2a4\ud2b8","permalink":"/blog/2019/07/03/JMH"}},"content":"typescript\ub85c \uac04\ub2e8\ud55c React \ubaa8\ub4c8\uc744 \uac1c\ubc1c\ud558\ub2e4\uac00 \ud654\uba74 \uad6c\uc131\uc774 \ud544\uc694\ud574\uc11c Sass\ub97c \uc0ac\uc6a9\ud558\ub824\ub2e4\uac00 \uc54c\uac8c \ub410\uc5b4\uc694.\\n\\nCRA<sub>create-react-app</sub>\uc73c\ub85c \uad6c\uc131\ud588\ub354\ub2c8 \uc544\uc8fc \uac04\ud3b8\ud558\uac8c \ucc98\ub9ac\uac00 \ub418\ub354\ub77c\uace0\uc694.\\n```shell\\nnpm install node-sass\\n```\\n\uc774\ub807\uac8c \uadf8\ub0e5 \uc758\uc874\uad00\uacc4\ub9cc \ub9cc\ub4e4\uc5b4\uc8fc\uba74 \uc54c\uc544\uc11c sass-loader\uac00 \ucd94\uac00\ub418\ub098\ubd10\uc694.\\n\\nCRA v2 \ubd80\ud130\uc758 \ubcc0\ud654\uc911\uc5d0 \ud558\ub098\uc778 \uac83 \uac19\uc740\ub370,\\n[velopert\ub2d8\uc758 \ud3ec\uc2a4\ud2b8](https://velog.io/@velopert/create-react-app-v2)\uc5d0\uc11c \ud655\uc778\ud588\uace0, \uc0c8\ub85c\uc6b4 v2\uc758 \uae30\ub2a5\ub4e4\uc744 \uc5b8\uc81c\ub098 \uadf8\ub807\ub4ef \uc798 \uc124\uba85\ud574 \uc8fc\uc168\uc73c\ub2c8 \ud655\uc778\ud574 \ubcf4\uc138\uc694."},{"id":"/2019/07/03/JMH","metadata":{"permalink":"/blog/2019/07/03/JMH","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-07-03-JMH.md","source":"@site/blog/2019-07-03-JMH.md","title":"JMH(Java Measurement Harness) \ubca4\uce58\ub9c8\ud0b9 \ud14c\uc2a4\ud2b8","description":"\ubca4\uce58\ub9c8\ud0b9 \ud14c\uc2a4\ud2b8\ub97c \ud574\ubcf4\uac8c\ub3c4 \ub418\ub124\uc694.","date":"2019-07-03T21:00:00.000Z","formattedDate":"2019\ub144 7\uc6d4 3\uc77c","tags":[{"label":"benchmarking","permalink":"/blog/tags/benchmarking"},{"label":"measurement","permalink":"/blog/tags/measurement"}],"readingTime":4.325,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"JMH(Java Measurement Harness) \ubca4\uce58\ub9c8\ud0b9 \ud14c\uc2a4\ud2b8","date":"2019-07-03T21:00","tags":["benchmarking","measurement"]},"prevItem":{"title":"create-react-app v2(with typescript)\uc5d0\uc11c Sass \uc0ac\uc6a9\uc774 \uc26c\uc6cc\uc84c\uc5b4\uc694","permalink":"/blog/2019/07/10/create-react-app-sass"},"nextItem":{"title":"\uad6c\ubb38 \ud615\uc2dd(Coding Style \ub610\ub294 Syntax Style) \uac00\uc774\ub4dc","permalink":"/blog/2019/05/28/coding-style-guide"}},"content":"\ubca4\uce58\ub9c8\ud0b9 \ud14c\uc2a4\ud2b8\ub97c \ud574\ubcf4\uac8c\ub3c4 \ub418\ub124\uc694.  \\n\ud3ed\uc8fc\ud558\ub294 \uc11c\ube44\uc2a4\ub97c \uac1c\ubc1c\ud558\ub294\uac83\ub3c4 \uc544\ub2cc\ub370, \uadf8\ub0e5 \uc2ec\uc2ec\ud480\uc774\ub85c \uc11c\ud551\ud558\ub2e4\uac00 \ubcf4\uc5ec\uc11c \ud574\ubd24\uc5b4\uc694.  \\n\\n### \ud2b9\uc9d5\\n - Oracle\\b \uc5d0\uc11c JVM \uac1c\ubc1c\ud558\ub294 \ubd84\ub4e4\uc774 \ub9cc\ub4dc\uc168\ub2e4\uace0 \ud558\uace0\\n - Java9 \ubd80\ud130\ub294 \uacf5\uc2dd\uc801\uc73c\ub85c JDK\uc5d0 \uac19\uc774 \ubc30\ud3ec\ub41c\ub2e4\uace0 [\uc934\uc774\uc934\uc774\ub931](https://jayjaylab.tistory.com/26)\uc5d0 \ud6cc\ub96d\ud55c \ubd84\uc774 \uc815\ub9ac\ud55c \ub0b4\uc6a9\uc744 \ucc38\uc870\ud558\uba74 \ub354 \ub9ce\uc740 \ud2b9\uc9d5\uc744 \uc5bb\uc744 \uc218 \uc788\uaca0\uc5b4\uc694.\\n\\n### \uc2dc\uc791\\n\ub2f9\uc5f0\ud788 [JMH \uacf5\uc2dd\uc0ac\uc774\ud2b8](http://openjdk.java.net/projects/code-tools/jmh/)\uc5d0\uc11c \ud655\uc778\ud558\uc2dc\ub294\uac8c \uc88b\uaca0\uc8e0. \uc800\ub294 \uc798 \ubaa8\ub974\uba74\uc11c \ub9c9\ud574\ubcf8\uac70\ub77c\uc11c...  \\n[\uc0d8\ud50c \ucf54\ub4dc\ub4e4](http://hg.openjdk.java.net/code-tools/jmh/file/39ed8b3c11ce/jmh-samples/src/main/java/org/openjdk/jmh/samples)\uc774 \ubcf4\uace0 \ub530\ub77c\ud558\uae30 \uc88b\uc740 \uac83 \uac19\uace0\uc694.\\n\\n### \uc900\ube44\\n\ud504\ub85c\uc81d\ud2b8\uc5d0 JMH\uc5d0 \uad00\ub828\ub41c dependency\ub97c \ucd94\uac00 \ud574\uc694. \uc800\ub294 gradle \ud658\uacbd\uc774\ub2c8\uae4c,\\n```gradle\\n...\\n\\ndependencies {\\n    ...\\n    testImplementation \'org.openjdk.jmh:jmh-core:1.21\'\\n    testImplementation \'org.openjdk.jmh:jmh-generator-annprocess:1.21\'\\n}\\n```\\n\uc774\ub807\uac8c `org.openjdk.jmh` \uc758 `jmh-core` \ub791 `jmh-generator-annprocess` \ub97c \ucd94\uac00\ud558\uace0, [IntellJ\uc5d0 \ud50c\ub7ec\uadf8\uc778](https://github.com/artyushov/idea-jmh-plugin) \uc744 \uc124\uce58 \ud588\uc5b4\uc694.\\n\ud50c\ub7ec\uadf8\uc778 \uc5c6\uc774\\n```java\\nimport org.openjdk.jmh.annotations.*;\\n\\nclass BenchmarkTest {\\n\\n  ...\\n\\n  public static void main(String[] args) throws RunnerException {\\n    Options opt = new OptionsBuilder()\\n        .include(BenchmarkTest.class.getSimpleName())\\n        .warmupIterations(3)\\n        .measurementIterations(1)\\n        .forks(1)\\n        .build();\\n\\n    new Runner(opt).run();\\n\\n  }\\n}\\n```\\n\uc774\ub807\uac8c \uc2e4\ud589\ud574\ub3c4 \ub418\uace0\uc694.\\n\\n### \uc2e4\ud589\\n\ucd5c\uadfc\uc5d0 \uc815\uc801\ubd84\uc11d\uc744 \ud558\uba74\uc11c `java.util.Random` \uc744 `java.security.SecureRandom` \uc73c\ub85c \ubc14\uafb8\ub77c\uace0 \uc9c0\uc801\ub41c\uac8c \uc788\uc5c8\uac70\ub4e0\uc694. \uadf8\ub798\uc11c \uadf8 \ub450\uac00\uc9c0\ub97c \ubca4\uce58\ub9c8\ud0b9 \ud574\ubd24\uc5b4\uc694.\\n\\n```java\\n@State(Scope.Thread)\\n@OutputTimeUnit(TimeUnit.MILLISECONDS)\\n@Fork(1)\\n@Warmup(iterations = 1)\\n@BenchmarkMode(Mode.Throughput)\\n@Measurement(iterations = 1)\\npublic class BenchmarkTest {\\n\\n  private final Random random = new Random();\\n\\n  private final SecureRandom secureRandom = new SecureRandom();\\n\\n  @Benchmark\\n  public void measureRandom() {\\n    random.nextDouble();\\n  }\\n\\n  @Benchmark\\n  public void measureSecureRandom() {\\n    secureRandom.nextDouble();\\n  }\\n}\\n```\\n\\n\uc2e4\ud589 \uacb0\uacfc \ub2e4\uc74c\uacfc \uac19\uc774 \ub9ac\ud3ec\ud2b8 \ub418\ub124\uc694.\\n```shell\\n# JMH version: 1.21\\n# VM version: JDK 1.8.0_181, Java HotSpot(TM) 64-Bit Server VM, 25.181-b13\\n# VM invoker: /Library/Java/JavaVirtualMachines/jdk1.8.0_181.jdk/Contents/Home/jre/bin/java\\n# VM options: -Dfile.encoding=UTF-8\\n# Warmup: 1 iterations, 10 s each\\n# Measurement: 1 iterations, 10 s each\\n# Timeout: 10 min per iteration\\n# Threads: 1 thread, will synchronize iterations\\n# Benchmark mode: Throughput, ops/time\\n# Benchmark: BenchmarkTest.measureRandom\\n\\n# Run progress: 0.00% complete, ETA 00:00:40\\n# Fork: 1 of 1\\n# Warmup Iteration   1: 41945.262 ops/ms\\nIteration   1: 42456.015 ops/ms\\n\\n\\nResult \\"BenchmarkTest.measureRandom\\":\\n  42456.015 ops/ms\\n\\n\\n# JMH version: 1.21\\n# VM version: JDK 1.8.0_181, Java HotSpot(TM) 64-Bit Server VM, 25.181-b13\\n# VM invoker: /Library/Java/JavaVirtualMachines/jdk1.8.0_181.jdk/Contents/Home/jre/bin/java\\n# VM options: -Dfile.encoding=UTF-8\\n# Warmup: 1 iterations, 10 s each\\n# Measurement: 1 iterations, 10 s each\\n# Timeout: 10 min per iteration\\n# Threads: 1 thread, will synchronize iterations\\n# Benchmark mode: Throughput, ops/time\\n# Benchmark: BenchmarkTest.measureSecureRandom\\n\\n# Run progress: 50.00% complete, ETA 00:00:20\\n# Fork: 1 of 1\\n# Warmup Iteration   1: 1826.455 ops/ms\\nIteration   1: 1837.092 ops/ms\\n\\n\\nResult \\"BenchmarkTest.measureSecureRandom\\":\\n  1837.092 ops/ms\\n\\n\\n# Run complete. Total time: 00:00:41\\n\\nREMEMBER: The numbers below are just data. To gain reusable insights, you need to follow up on\\nwhy the numbers are the way they are. Use profilers (see -prof, -lprof), design factorial\\nexperiments, perform baseline and negative tests that provide experimental control, make sure\\nthe benchmarking environment is safe on JVM/OS/HW level, ask for reviews from the domain experts.\\nDo not assume the numbers tell you what you want them to tell.\\n\\nBenchmark                           Mode  Cnt      Score   Error   Units\\nBenchmarkTest.measureRandom        thrpt       42456.015          ops/ms\\nBenchmarkTest.measureSecureRandom  thrpt        1837.092          ops/ms\\n\\n```\\n`Score` \uac00 42\ubc30\ucbe4 \ucc28\uc774\ub098\ub2c8\uae4c \uadf8\uac8c \uc131\ub2a5\ucc28\uc774\ub77c\uace0 \ubcf4\uba74 \ub420\uac83 \uac19\ub124\uc694. `REMEMBER` \ubd80\ubd84\uc5d0 \uc801\ud78c \uae00\uc744 \ubcf4\ub2c8\uae4c \uadf8\ub0e5 \ub370\uc774\ud130\ub85c\ub9cc \ucc38\uc870\ud558\ub77c\uace0 \ucca8\uc5b8\ud558\ub294 \uac83 \uac19\uc544\uc694. \uc7ac\uc0ac\uc6a9\ud558\ub294 \ud1b5\ucc30\uc744 \uc5bb\uc73c\ub824\uba74 \uc22b\uc790\ub4e4\uc774 \uac00\ub9ac\ud0a4\ub294 \uac78 \ub530\ub77c\uac00\ub77c\uace0 \ud558\uba74\uc11c\uc694.\\n\\n### \ub9fa\uc74c\\n\uc800\ub294 \uadf8\ub0e5 \uc7ac\ubbf8\ub85c \'\uc774\ub7f0\uac83\ub3c4 \uc788\uad6c\ub098\' \ud558\uace0\uc120 \uc2dc\uc791\ud574\ubd24\ub294\ub370 \uc7ac\uc0ac\uc6a9\uc131\uc744 \uc704\ud574 refactoring\uc744 \ud558\uba74\uc11c \ucc44\uc810\uc2dd\uc73c\ub85c \uc218\uce58\ub97c \ud655\uc778\ud574\uac00\uba74, \uc758\uc695\ub3c4 \uc0dd\uae30\uace0 \ubcf4\ub78c\ub3c4 \uc0dd\uae38\uc9c0\ub294 \uc54a\uc744\uae4c \uc2f6\uae30\ub3c4 \ud574\uc694.  \\n\\n\ub354 \ud65c\uc6a9\ub3c4\uac00 \ub192\uc744\ud150\ub370 \uc81c \uc218\uc900\uc5d0\uc11c\ub294 \uc774\uc815\ub3c4 \ubc16\uc5d0 \ubaa8\ub974\uaca0\ub124\uc694. \uac04\uac04\ud788 \uc131\ub2a5\uc774\uc288\uc5d0 \ud65c\uc6a9\ud574\uc11c \ub354 \uc88b\uc740 \ud301\uc740 \ub610 \uc815\ub9ac\ud574 \ubd10\uc57c\uaca0\uc5b4\uc694."},{"id":"/2019/05/28/coding-style-guide","metadata":{"permalink":"/blog/2019/05/28/coding-style-guide","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-28-coding-style-guide.md","source":"@site/blog/2019-05-28-coding-style-guide.md","title":"\uad6c\ubb38 \ud615\uc2dd(Coding Style \ub610\ub294 Syntax Style) \uac00\uc774\ub4dc","description":"\ucd5c\uadfc\uc5d0 \ud074\ub9ac\ucf54\ub529 \uc774\ub098 \ub514\uc790\uc778\ud328\ud134 \uc5d0 \ub2e4\uc2dc \uad00\uc2ec\uc744 \uac16\uace0 \uc788\uc5b4\uc694.","date":"2019-05-28T21:00:00.000Z","formattedDate":"2019\ub144 5\uc6d4 28\uc77c","tags":[{"label":"programming","permalink":"/blog/tags/programming"},{"label":"convention","permalink":"/blog/tags/convention"}],"readingTime":1.6,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"\uad6c\ubb38 \ud615\uc2dd(Coding Style \ub610\ub294 Syntax Style) \uac00\uc774\ub4dc","date":"2019-05-28T21:00","tags":["programming","convention"]},"prevItem":{"title":"JMH(Java Measurement Harness) \ubca4\uce58\ub9c8\ud0b9 \ud14c\uc2a4\ud2b8","permalink":"/blog/2019/07/03/JMH"},"nextItem":{"title":"MapStruct \ub97c idea(IntelliJ) \uc5d0\uc11c gradle \ub85c \uc368\uc11c duplicate class \uc624\ub958\uac00 \ub098\uba74...","permalink":"/blog/2019/06/19/mapstruct-gradle-idea"}},"content":"\ucd5c\uadfc\uc5d0 `\ud074\ub9ac\ucf54\ub529` \uc774\ub098 `\ub514\uc790\uc778\ud328\ud134` \uc5d0 \ub2e4\uc2dc \uad00\uc2ec\uc744 \uac16\uace0 \uc788\uc5b4\uc694.  \\n\uc5f0\ucc28\uac00 \uc5b4\ub290\uc815\ub3c4 \ub410\uc9c0\ub9cc \uc81c\uc790\ub9ac \uac78\uc74c\uc744 \ud558\ub294 \uac83 \uac19\ub2e4\ub294 \ub290\ub08c\uc5d0 \uae30\ubcf8\uc73c\ub85c \ud68c\uae30\ud558\ub294 \ub9c8\uc74c\uc774 \uc0dd\uaca8\uc11c\uc694.\\n\\n\uc5ec\ub7ec\uac00\uc9c0\ub97c \uc811\ud558\ub294 \ub3c4\uc911\uc5d0 \uac04\uacfc\ud558\uace0 \ud5c8\ud22c\ub85c \uc9c0\ub098\uce58\ub358 \uad00\ub840\uc911\uc5d0 **`\uad6c\ubb38 \ud615\uc2dd`** \uc774 \uc911\uc694\ud558\ub2e8\uac78 \uc774\ud574 \ud588\uc5b4\uc694.\\n\\n> [\\"\ucf54\ub529 \uc2a4\ud0c0\uc77c\uc5d0 \ub300\ud574 \ub17c\uc7c1\ud558\ub294 \uc774\uc720\\"](http://www.mimul.com:80/pebble/default/addTrackBack.action?entry=1559304696070&token=-8812272824716390057) \ub77c\ub294 \ubc88\uc5ed \uae00\uc5d0\uc11c \uc774\ud574\ub97c \uc5bb\uc5c8\uace0, \uc774 \uae00\uc740 [\\"Why We Argue: Style\\"](https://www.sandimetz.com/blog/2017/6/1/why-we-argue-style) \ub97c \ubc88\uc5ed\ud55c \ub0b4\uc6a9\uc774\ub77c\uace0 \ud558\ub124\uc694.\\n\\n## IDEA \uc5d0 Java Google Style \uc801\uc6a9\\n\\n1. [github \uad6c\uae00 styleguide](https://github.com/google/styleguide) \uc5d0\uc11c\\n2. [intellij-java-google-style.xml](https://raw.githubusercontent.com/google/styleguide/gh-pages/intellij-java-google-style.xml) \ud30c\uc77c \ub2e4\uc6b4\ub85c\ub4dc\ud558\uace0\\n3. Preference > Editor > Code Style  \\n   ![](../static/files/20190528/intellij_preferences.png)\\n4. \\"Import Scheme\\" \uc73c\ub85c 1\uc5d0\uc11c \ub2e4\uc6b4\ub85c\ub4dc\ud55c \ud30c\uc77c \uc120\ud0dd\\n\\n## conclusion\\n\\n\uac1c\uc778\uc801\uc73c\ub85c\ub294 \ud504\ub85c\uc81d\ud2b8 \ud30c\uc77c\ub85c \ubc84\uc804\uad00\ub9ac\ub97c \ud558\uac70\ub098, \ud300\uc6d0\uc774 \uacf5\uc720\ud560 \uc218 \uc788\ub294 \uc704\uce58\ub97c \ud1b5\ud574\uc11c \uacf5\ub3d9 \uc791\uc5c5\uc790\ub4e4\uc774 \ub3d9\uc2dc\uc5d0 \ud65c\uc6a9 \ud560 \uc218 \uc788\ub294 \ubc29\ubc95\uc744 \ubaa8\uc0c9\ud574\uc57c\ub9cc \ud6a8\uacfc\uac00 \uc788\uc744 \uac83 \uac19\ub124\uc694.\\n\\n\uad6c\ubb38 \ud615\uc2dd\uc758 \uad00\ub840\ub97c \uc9c0\ucf1c\uc57c\ud558\ub294 \uc774\uc720\uac00 **\ucf54\ub529\uc740 \uc791\uc131\ubcf4\ub2e4 \uc77d\ub294\ub370 \ub354 \ud070 \ube44\uc6a9\uc774 \ubc1c\uc0dd** \ud55c\ub2e4\ub294 \uac83\uc744 \ub2e4\uc2dc \ud55c\ubc88 \uc0c1\uae30 \ud574\ubd05\ub2c8\ub2e4."},{"id":"/2019/06/19/mapstruct-gradle-idea","metadata":{"permalink":"/blog/2019/06/19/mapstruct-gradle-idea","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-06-19-mapstruct-gradle-idea.md","source":"@site/blog/2019-06-19-mapstruct-gradle-idea.md","title":"MapStruct \ub97c idea(IntelliJ) \uc5d0\uc11c gradle \ub85c \uc368\uc11c duplicate class \uc624\ub958\uac00 \ub098\uba74...","description":"\uc774\ub7f0\uac8c \uc0ac\uc2e4, \uc870\uae08 \uc4f0\uae30 \ud798\ub4e0 \ub0b4\uc6a9\uc778 \uac83 \uac19\uc544\uc694.","date":"2019-05-28T21:00:00.000Z","formattedDate":"2019\ub144 5\uc6d4 28\uc77c","tags":[{"label":"DTO","permalink":"/blog/tags/dto"},{"label":"MapStruct","permalink":"/blog/tags/map-struct"}],"readingTime":1.785,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"MapStruct \ub97c idea(IntelliJ) \uc5d0\uc11c gradle \ub85c \uc368\uc11c duplicate class \uc624\ub958\uac00 \ub098\uba74...","date":"2019-05-28T21:00","tags":["DTO","MapStruct"]},"prevItem":{"title":"\uad6c\ubb38 \ud615\uc2dd(Coding Style \ub610\ub294 Syntax Style) \uac00\uc774\ub4dc","permalink":"/blog/2019/05/28/coding-style-guide"},"nextItem":{"title":"Javascript Generator","permalink":"/blog/2019/05/26/javascript-generator"}},"content":"\uc774\ub7f0\uac8c \uc0ac\uc2e4, \uc870\uae08 \uc4f0\uae30 \ud798\ub4e0 \ub0b4\uc6a9\uc778 \uac83 \uac19\uc544\uc694.  \\n\uac1c\uc778\uc801\uc778 \uac1c\ubc1c \ud658\uacbd\uc758 \ubb38\uc81c\uc774\uac70\ub098 \uc81c\uac00 \uc2e4\uc218\ud55c \uc124\uc815\uc758 \ubb38\uc81c\uc774\uac70\ub098 \ud560\uae4c\ubd10\uc11c, \'\uc774\ub7f0 \uae30\ub2a5 \uc624\ub958\ub97c \uc774\ub807\uac8c \ud574\uacb0\ud588\ub2e4\' \ub77c\uace0 \uc62c\ub9ac\ub294\uac8c \ub9de\ub294\uac74\uac00 \uc2f6\uc5b4\uc11c\uc694.  \\n\uadf8\ub798\uc11c \uc544\uc6b8\ub7ec \ub9d0\uc500\ub4dc\ub9ac\uba74 \uc815\ub2f5\uc774 \uc544\ub2d0 \uc218\ub3c4 \uc788\uc73c\ub2c8\uae4c \uacf5\uc2dd \ucc38\uc870\ubb38\uc11c\ub97c \ucc3e\uc544 \ubcf4\uc2dc\uace0 stackOverflow \uac19\uc740 \uacf3\ub3c4 \uc798 \ub4a4\uc838\ubcf4\uc2dc\ub294 \uac78 \uc6b0\uc120 \ucd94\ucc9c \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n### \uc99d\uc0c1\\n\uc5b4\ud50c\ub9ac\ucf00\uc774\uc158(\ud14c\uc2a4\ud2b8\ub3c4 \uc5ed\uc2dc) \uc2e4\ud589\ud558\uac8c \ub418\uba74 `MapStruct` \uc5d0\uc11c generated \ub41c \uc18c\uc2a4\uac00 `build/generated/sources/annotationProcessor/java` \ub514\ub809\ud1a0\ub9ac\uc5d0 .java \ud30c\uc77c\ub85c \ub098\ud0c0\ub098\uac8c \ub418\uc796\uc544\uc694.  \\n\uacb0\uacfc\uc801\uc73c\ub85c \uadf8\uac83\ub4e4\uc774 \\"duplicate class\\" \ub77c\ub294 \uc5d0\ub7ec\uc758 \uc6d0\uc778\uc774 \ub418\ub294\uac70\uc8e0.\\n\\n### \ud574\uacb0\\n> \ub2e4\uc2dc \ud55c\ubc88 \ub9d0\uc500\ub4dc\ub9ac\uc9c0\ub9cc \uc774\uac74 \uc81c\uac00 \ubb38\uc81c\ub97c \ud574\uacb0\ud55c \ubc29\ubc95\uc774\uc9c0 \uc815\ub2f5\uc774 \uc544\ub2c8\ub77c\ub294 \uac70...\\n\\n[\uacf5\uc2dd \ubb38\uc11c](http://mapstruct.org/documentation/stable/reference/html/#_gradle)\uc5d0 \ub098\uc628 \ub300\ub85c \uc9c4\ud589\uc744 \ud558\uc2dc\uace0 \ub09c \ud6c4,  \\n`build.gradle` \uc5d0\uc11c\\n\\n```groovy\\ncompileJava {\\n    options.compilerArgs = [\\n            \'-Amapstruct.defaultComponentModel=spring\'\\n    ]\\n\\n    doLast {\\n        delete fileTree(\'build\') {  // \uc0ad\uc81c\ub97c \ud558\ub294\ub370, build \ub514\ub809\ud1a0\ub9ac \uc911\uc5d0\uc11c\\n            include \'**/*.java\'     // *.java \ud30c\uc77c\uc744 \uc0ad\uc81c\\n        }\\n    }\\n}\\n```\\n\\n\uc774\ub807\uc2b5\ub2c8\ub2e4. \ub2e8\uc21c\ud788 build \ub514\ub809\ud1a0\ub9ac\uc5d0 java \ud30c\uc77c\uc744 \uc9c0\uc6b0\ub294 \uac78\ub85c \ud574\uacb0 \ud588\uc5b4\uc694.\\n\\n### \ub9c8\ubb34\ub9ac\\n\ub354 \uc88b\uc740 \ubc29\ubc95\uc774 \uc788\uac70\ub098, \uc774 \ubc29\ubc95\uc774 \ubb38\uc81c\uac00 \ub420 \uc18c\uc9c0\uac00 \uc788\ub2e4\uba74 \ud53c\ub4dc\ubc31 \uc8fc\uc2dc\uba74 \uc88b\uaca0\uc2b5\ub2c8\ub2e4."},{"id":"/2019/05/26/javascript-generator","metadata":{"permalink":"/blog/2019/05/26/javascript-generator","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-26-javascript-generator.md","source":"@site/blog/2019-05-26-javascript-generator.md","title":"Javascript Generator","description":"redux-saga \ub97c \ucc98\uc74c \uc811\ud558\uba74\uc11c generator \ub85c \uad6c\ud604\ub41c \ub0b4\uc6a9\uc744 \ubcf4\uace0 \uc815\ub9ac\ud574\ubd05\ub2c8\ub2e4. ES6+ \ub9db\ubcf4\uae30 \ud560\ub54c \ub300\ucda9 \ubc30\uc6cc\uc11c \uc778\uc9c0 \uc5ed\uc2dc\ub098 \uc815\ud655\ud55c \ub3d9\uc791\uc774 \uc774\ud574 \uc548\ub418\ub354\ub77c\uace0\uc694.","date":"2019-05-26T23:00:00.000Z","formattedDate":"2019\ub144 5\uc6d4 26\uc77c","tags":[{"label":"javascript","permalink":"/blog/tags/javascript"},{"label":"generator","permalink":"/blog/tags/generator"}],"readingTime":0.65,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"Javascript Generator","date":"2019-05-26T23:00","tags":["javascript","generator"]},"prevItem":{"title":"MapStruct \ub97c idea(IntelliJ) \uc5d0\uc11c gradle \ub85c \uc368\uc11c duplicate class \uc624\ub958\uac00 \ub098\uba74...","permalink":"/blog/2019/06/19/mapstruct-gradle-idea"},"nextItem":{"title":"JPA @Inheritance","permalink":"/blog/2019/05/20/jpa-inheritance"}},"content":"`redux-saga` \ub97c \ucc98\uc74c \uc811\ud558\uba74\uc11c `generator` \ub85c \uad6c\ud604\ub41c \ub0b4\uc6a9\uc744 \ubcf4\uace0 \uc815\ub9ac\ud574\ubd05\ub2c8\ub2e4. ES6+ \ub9db\ubcf4\uae30 \ud560\ub54c \ub300\ucda9 \ubc30\uc6cc\uc11c \uc778\uc9c0 \uc5ed\uc2dc\ub098 \uc815\ud655\ud55c \ub3d9\uc791\uc774 \uc774\ud574 \uc548\ub418\ub354\ub77c\uace0\uc694.\\n\\n\ucc38\uc870\ub294,\\n - [https://developer.mozilla.org/ko/docs/Web/JavaScript/Reference/Global_Objects/Generator](https://developer.mozilla.org/ko/docs/Web/JavaScript/Reference/Global_Objects/Generator)\\n - [https://developer.mozilla.org/ko/docs/Web/JavaScript/Reference/Statements/function*](https://developer.mozilla.org/ko/docs/Web/JavaScript/Reference/Statements/function*)\\n\\n\ud45c\ud604\uc2dd\uc740 \ucc38\uc870\ud55c \ub9c1\ud06c\ub97c \ud1b5\ud574\uc11c \uc2ed\ubd84 \uc774\ud574 \ud560 \uc218 \uc788\uc744 \ud14c\uace0, \ud65c\uc6a9 \ubc94\uc704\ub098 \uc0ac\ub840\ub294 `redux-saga` \ub97c \uc644\uc804\ud788 \uc774\ud574\ud558\uace0 \ub098\uba74 \ubb54\uac00 \uad81\ub9ac\ud560 \uc218 \uc788\uc9c0 \uc54a\uc744\uae4c \uc2f6\uc5b4\uc694.  \\n\\n\uadf8 \ud6c4\uc5d0 \uacc4\uc18d \uc774\uc5b4 \uac08\uac8c\uc694.  \\n```c\\n// TODO\\n```"},{"id":"/2019/05/20/jpa-inheritance","metadata":{"permalink":"/blog/2019/05/20/jpa-inheritance","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-20-jpa-inheritance.md","source":"@site/blog/2019-05-20-jpa-inheritance.md","title":"JPA @Inheritance","description":"\uae40\uc601\ud55c\ub2d8\uc758 \uc790\ubc14 ORM \ud45c\uc900 JPA \ud504\ub85c\uadf8\ub798\ubc0d \uc73c\ub85c \uc2a4\ud130\ub514\ub97c \ud558\uba74\uc11c \uc815\ub9ac\ud55c \ub0b4\uc6a9\uc774\uc5c8\ub294\ub370, \ucc3e\uc544\ubcf4\uae30 \uc27d\uac8c \uac04\ub7b5\ud654 \ud574\ubd05\ub2c8\ub2e4.","date":"2019-05-20T21:00:00.000Z","formattedDate":"2019\ub144 5\uc6d4 20\uc77c","tags":[{"label":"java","permalink":"/blog/tags/java"},{"label":"jpa","permalink":"/blog/tags/jpa"}],"readingTime":2.63,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"JPA @Inheritance","date":"2019-05-20T21:00","tags":["java","jpa"]},"prevItem":{"title":"Javascript Generator","permalink":"/blog/2019/05/26/javascript-generator"},"nextItem":{"title":"positive, nagative \uadf8\ub9ac\uace0 lookahead lookbehind","permalink":"/blog/2019/05/13/positive-nagative-and-lookahead-lookbehind"}},"content":"[\uae40\uc601\ud55c\ub2d8\uc758 \uc790\ubc14 ORM \ud45c\uc900 JPA \ud504\ub85c\uadf8\ub798\ubc0d](http://www.yes24.com/Product/Goods/19040233?scode=032&OzSrank=1) \uc73c\ub85c \uc2a4\ud130\ub514\ub97c \ud558\uba74\uc11c \uc815\ub9ac\ud55c \ub0b4\uc6a9\uc774\uc5c8\ub294\ub370, \ucc3e\uc544\ubcf4\uae30 \uc27d\uac8c \uac04\ub7b5\ud654 \ud574\ubd05\ub2c8\ub2e4.  \\n[github](https://github.com/greenn-lab/blog-codes-java-jpa-2019-05-20-jpa-inheritance) \uc5d0 \uc608\uc81c \uc18c\uc2a4\ub3c4 \uc62c\ub77c\uac00 \uc788\uace0\uc694.\\n\\n# \uc0c1\uc18d \ubc29\uc2dd\\n\\nRDB \uc0c1\uc5d0\uc11c \uc0c1\uc18d\uc758 \uac1c\ub150\uc73c\ub85c Entity\ub97c \ub9cc\ub4e4 \ub54c `@Inheritance` \ub97c \uc0ac\uc6a9\ud558\uc796\uc544\uc694.  \\n\uadf8\ub7f0\ub370 \ubc29\uc2dd\uc774 3\uac00\uc9c0\uac00 \uc788\uc5b4\uc11c, \uac01\uac01 \ub2e4\ub978 \ud14c\uc774\ube14\uacfc \ub300\uc751\ud558\uac8c \ub418\ub354\ub77c\uace0\uc694.\\n\\n## 1. JOINED\\n\uac01 Entity \ubcc4\ub85c \ub530\ub85c \ud14c\uc774\ube14\uc774 \ub9cc\ub4e4\uc5b4 \uc9c0\ub294 \ubc29\uc2dd\uc774\uc5d0\uc694.  \\n```java\\n@Entity\\n@Inheritance(strategy = InherianceType.JOINED)\\n@DiscriminatorColumn(name = \\"MEMBER_TYPE\\")\\nabstract class Member {\\n  @Id\\n  @Column(name = \\"MEMBER_ID\\")\\n  private Long id;\\n\\n  private String username;\\n  private Integer password;\\n  ...\\n}\\n```\\n```java\\n@Entity\\n@DiscriminatorValue(\\"ADMIN\\")\\nclass Admin extends Member {\\n  @Column(name = \\"DEPT_CD\\")\\n  private String department;\\n}\\n```\\n```java\\n@Entity\\n@DiscriminatorValue(\\"SELLER\\")\\nclass Seller extends Member {\\n  private String company;\\n}\\n```\\n```java\\n@Entity\\n@DisciriminatorValue(\\"CUSTOMER\\")\\nclass Customer extends Member {\\n  private String email;\\n}\\n```\\n\uc774\ub807\uac8c \ub418\uba74 \ub2e4\uc74c\uacfc \uac19\uc740 \uad00\uacc4\ub97c \uac00\uc9c0\uac8c \ub418\ub294 \uac70\uc8e0.\\n![](../static/files/20190520/inheritance-joined.png)\\n\\n> `Member` \uc5d0 `@DiscriminatorColumn(...)` \uc744 \uc0dd\ub7b5 \ud560 \uc218 \uc788\uc5b4\uc694.  \\n> \uc0c1\uc18d\ubc1b\ub294 \ub300\uc0c1\uc744 \uad6c\ubd84\ud560 \uac12\uc774 \uc5c6\ub2e4\uba74 \uad73\uc774 \ub123\uc9c0 \uc54a\uc544\ub3c4 \ub418\ub294\uac70\uc8e0. \ub2f9\uc5f0\ud788 `@DiscriminatorValue(...)` \ub3c4 \uc548\uc368\ub3c4 \ub418\uaca0\ub124\uc694. \\n\\n## 2. SINGLE TABLE\\n```java\\n@Entity\\n@Inheritance(strategy = InheritanceType.SINGLE_TABLE)\\n@DiscriminationColumn(name = \\"MEMBER_TYPE\\")\\nclass Member {\\n  @Id\\n  @Column(name = \\"MEMBER_ID\\")\\n  private Long id;\\n  \\n  private String username;\\n  private String password;\\n  private String company;\\n  \\n  @Column(name = \\"DEPT_CD\\")\\n  private String department;\\n  \\n  private String email;\\n}\\n```\\n\uc774\ub7f0\uc2dd\uc73c\ub85c \ud558\ub098\uc758 \ud14c\uc774\ube14\uc5d0 \ubabd\ub545 \ub123\ub294 \uac70\uc5d0\uc694.    \\n\ub098\uba38\uc9c0 \ud074\ub798\uc2a4\ub294.\\n```java\\n@Entity\\n@DiscriminatorValue(\\"ADMIN\\")\\nclass Admin extends Member {\\n}\\n```\\n```java\\n@Entity\\n@DiscriminatorValue(\\"SELLER\\")\\nclass Seller extends Member {\\n}\\n```\\n```java\\n@Entity\\n@DiscriminatorValue(\\"CUSTOMER\\")\\nclass CUSTOMER extends Member {\\n}\\n```\\n\uadf8\ub7ec\uba74 Schema\ub294 \uc774\ub807\uac8c \uc0dd\uc131\ub429\ub2c8\ub2e4.  \\n![](../static/files/20190520/inheritance-single-table.png)  \\n \\n\\n## 3. TABLE PER CLASS\\n```java\\n@Entity\\n@Inheritance(strategy = InheritanceType.TABLE_PER_CLASS)\\nabstract class Member {\\n  @Id\\n  @Column(name = \\"MEMBER_ID\\")\\n  private Long id;\\n\\n  private String username;\\n  private String password;\\n}\\n```\\n\uc5b4\ucc28\ud53c Entity \uac00 \uc0c1\uc18d \ub300\uc0c1 \ud56d\ubaa9\ubcc4\ub85c \ub530\ub85c \uc0dd\uaca8\ub0a0 \uac70\ub2c8\uae4c `@DiscriminationColumn(Value)` \ub294 \ud544\uc694 \uc5c6\uad70\uc694.\\n```java\\n@Entity\\nclass Admin extends Member {\\n  @Column(name = \\"DEPT_CD\\")\\n  private String department;\\n}\\n\\n```\\n```java\\n@Entity\\nclass Customer extends Member {\\n  private String email;\\n}\\n```\\n```java\\n@Entity\\nclass Seller extends TablePerClassMember {\\n  private String company;\\n}\\n```\\n\uc774\ub807\uac8c \ud558\uba74,\\n![](../static/files/20190520/inheritance-table-per-class.png)\\n\uc774\ub807\uac8c Schema \ub098\uc635\ub2c8\ub2e4.  \\n\uc774 \uc804\ub7b5\uc740 `UNION ALL` \uc744 \uc0ac\uc6a9\ud558\uac8c \ub418\uc5b4\uc11c \ube44\ucd94 \ub418\ub294 \uac83 \uac19\uace0\uc694."},{"id":"/2019/05/13/positive-nagative-and-lookahead-lookbehind","metadata":{"permalink":"/blog/2019/05/13/positive-nagative-and-lookahead-lookbehind","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-13-positive-nagative-and-lookahead-lookbehind.md","source":"@site/blog/2019-05-13-positive-nagative-and-lookahead-lookbehind.md","title":"positive, nagative \uadf8\ub9ac\uace0 lookahead lookbehind","description":"\uc815\uaddc\ud45c\ud604\uc2dd\uc5d0\uc11c \uc55e\ucabd \ub610\ub294 \ub4b7\ucabd\uc758 \uc870\uac74\uc5d0 \ub530\ub77c\uc11c \uac80\uc0c9 \ubc29\uc2dd\uc744 \ub2e4\ub974\uac8c \ud560 \uc218 \uc788\ub294\ub370, \uc774\uac78 \ub9e4\ubc88 \uae4c\uba39\ub124\uc694\ud83d\ude25","date":"2019-05-13T13:00:00.000Z","formattedDate":"2019\ub144 5\uc6d4 13\uc77c","tags":[{"label":"regexp","permalink":"/blog/tags/regexp"}],"readingTime":2.075,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"positive, nagative \uadf8\ub9ac\uace0 lookahead lookbehind","date":"2019-05-13T13:00","tags":["regexp"]},"prevItem":{"title":"JPA @Inheritance","permalink":"/blog/2019/05/20/jpa-inheritance"},"nextItem":{"title":"java generic","permalink":"/blog/2019/05/10/java-generic"}},"content":"\uc815\uaddc\ud45c\ud604\uc2dd\uc5d0\uc11c \uc55e\ucabd \ub610\ub294 \ub4b7\ucabd\uc758 \uc870\uac74\uc5d0 \ub530\ub77c\uc11c \uac80\uc0c9 \ubc29\uc2dd\uc744 \ub2e4\ub974\uac8c \ud560 \uc218 \uc788\ub294\ub370, \uc774\uac78 \ub9e4\ubc88 \uae4c\uba39\ub124\uc694\ud83d\ude25\\n\\n### 1. Positive Lookahead\\n```java\\nregexp1(?=regexp2)\\n```\\n```java\\n\\"save me, save me. I need your love before I fall, fall.\\"\\n  .replaceAll(\\"(save me|fall)(?=\\\\.)\\", \\"(x2)\\");\\n```\\n\uacb0\uacfc\ub294 `save me, (x2). I need your love before I fall, (x2).` \uc774\ub807\uc2b5\ub2c8\ub2e4.  \\n\uc989, `regexp2` \uac00 \uc815\ubc29\ud5a5(\uc77d\uc5b4\ub098\uac00\ub294 \ubc29\ud5a5)\uc5d0 **\uc788\uc744 \uacbd\uc6b0 `regexp1` \uc774 \uac80\uc0c9** \ub429\ub2c8\ub2e4.\\n\\n### 2. Nagative Lookahead\\n```java\\nregexp1(?!regexp2)\\n```\\n```java\\n\\"save me, save me. I need your love before I fall, fall.\\"\\n  .replaceAll(\\"(save me|fall)(?!\\\\.)\\", \\"(..)\\");\\n```\\n\uacb0\uacfc\ub294 `(...), save me. I need your love before I (...), fall.` \uc774\ub807\uc2b5\ub2c8\ub2e4.\\n\uc989, `regexp2` \uac00 \uc815\ubc29\ud5a5(\uc77d\uc5b4\ub098\uac00\ub294 \ubc29\ud5a5)\uc5d0 **\uc5c6\uc744 \uacbd\uc6b0 `regexp1` \uc774 \uac80\uc0c9** \ub429\ub2c8\ub2e4.\\n\\n### 3. Positive Lookbehind\\n```java\\n(?<=regexp1)regexp2\\n```\\n```java\\n\\"save me, save me. I need your love before I fall, fall.\\"\\n  .replaceAll(\\"(?<=,)\\\\s*(save me|fall)\\", \\"(x2)\\");\\n```\\n\uacb0\uacfc\ub294 `save me, (x2). I need your love before I fall, (x2).` \uc774\ub807\uc2b5\ub2c8\ub2e4.  \\n\uc989, `regexp1` \uac00 \uc5ed\ubc29\ud5a5(\uc77d\uc5b4\ub098\uac00\ub294 \ubc18\ub300 \ubc29\ud5a5)\uc5d0 **\uc788\uc744 \uacbd\uc6b0 `regexp2` \uc774 \uac80\uc0c9** \ub429\ub2c8\ub2e4.\\n\\n### 4. Nagative Lookbehind\\n```java\\n(?<!regexp1)regexp2\\n```\\n```java\\n\\"save me, save me. I need your love before I fall, fall.\\"\\n  .replaceAll(\\"(?<!(,[ ]))(save me|fall)\\", \\"(..)\\");\\n```\\n\uacb0\uacfc\ub294 `save me, (x2). I need your love before I fall, (x2).` \uc774\ub807\uc2b5\ub2c8\ub2e4.  \\n\uc989, `regexp1` \uac00 \uc5ed\ubc29\ud5a5(\uc77d\uc5b4\ub098\uac00\ub294 \ubc18\ub300 \ubc29\ud5a5)\uc5d0 **\uc788\uc744 \uacbd\uc6b0 `regexp2` \uc774 \uac80\uc0c9** \ub429\ub2c8\ub2e4.\\n\\n\\n## conclusion\\n\uc815\ub9ac \ud55c\ub2e4\uace0 \ud588\ub294\ub370, \ub354 \ud5f7\uac08\ub9ac\uac8c \ud55c\uac74 \uc544\ub2cc\uc9c0 \uc2f6\uad70\uc694.  \\n\uadf8\ub9ac\uace0 IntelliJ \ub098 Eclipse \ub97c \uc4f0\uc2e0\ub2e4\uba74 **[RegexpTester(http://myregexp.com)](http://myregexp.com/)** \ub77c\ub294 \ud50c\ub7ec\uadf8\uc778\uc744 \uc0ac\uc6a9\ud574\ubcf4\uba74 \uc815\uaddc\ud45c\ud604\uc2dd \uc791\uc131\uc5d0 \ub3c4\uc6c0\uc774 \ub420\uae4c \uc2f6\uc5b4\uc694.\\n\\n\\n\uc815\uaddc\ud45c\ud604\uc2dd \uc790\uccb4\uac00 \uc6d0\ub798\ubd80\ud130 \ub9ce\uc740 \uaddc\uce59\ub4e4\uc774 \uc5bd\ud78c\uac70\ub2c8\uae4c, \uc6b0\ub9ac... \uc798 \ubabb\ud574\ub3c4 \uc790\uc2e0\uac10 \uc783\uc9c0 \ub9d0\uc544\uc694 \ud83e\udd1f"},{"id":"/2019/05/10/java-generic","metadata":{"permalink":"/blog/2019/05/10/java-generic","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-10-java-generic.md","source":"@site/blog/2019-05-10-java-generic.md","title":"java generic","description":"Generic Programming\uc740 \uac04\ub2e8\ud788 \uc815\uc758\ud558\uae30\uac00 \uc27d\uc9c4 \uc54a\uc740 \uac83 \uac19\uc544\uc694. \ud558\uc9c0\ub9cc \uc911\uc694\ud55c \uac74,","date":"2019-05-10T16:00:00.000Z","formattedDate":"2019\ub144 5\uc6d4 10\uc77c","tags":[{"label":"java","permalink":"/blog/tags/java"},{"label":"generic","permalink":"/blog/tags/generic"}],"readingTime":2.44,"truncated":false,"authors":[{"name":"Green","title":"\uc5b4\uc911\uc774\ub5a0\uc911\uc774 \ub4a4\uc8fd\ubc15\uc911 \uc5c9\ub9dd\uc9c4\uc9dc ...","url":"https://github.com/greenn-lab","imageURL":"https://github.com/greenn-lab.png","key":"green"}],"frontMatter":{"authors":["green"],"title":"java generic","date":"2019-05-10T16:00","tags":["java","generic"]},"prevItem":{"title":"positive, nagative \uadf8\ub9ac\uace0 lookahead lookbehind","permalink":"/blog/2019/05/13/positive-nagative-and-lookahead-lookbehind"}},"content":"[Generic Programming](https://ko.wikipedia.org/wiki/%EC%A0%9C%EB%84%A4%EB%A6%AD_%ED%94%84%EB%A1%9C%EA%B7%B8%EB%9E%98%EB%B0%8D)\uc740 \uac04\ub2e8\ud788 \uc815\uc758\ud558\uae30\uac00 \uc27d\uc9c4 \uc54a\uc740 \uac83 \uac19\uc544\uc694. \ud558\uc9c0\ub9cc \uc911\uc694\ud55c \uac74, \\n\\n> \ud558\ub098\uc758 \uac12\uc774 \uc5ec\ub7ec \ub2e4\ub978 \ub370\uc774\ud130 \ud0c0\uc785\ub4e4\uc744 \uac00\uc9c8 \uc218 \uc788\ub294 \uae30\uc220\uc5d0 \uc911\uc810\uc744 \ub450\uc5b4 \uc7ac\uc0ac\uc6a9\uc131\uc744 \ub192\uc77c \uc218 \uc788\ub294 \ud504\ub85c\uadf8\ub798\ubc0d \ubc29\uc2dd\\n\\n\uc774\ub77c\ub294 \uac70\uaca0\uc8e0.\\n\\n### \uac1d\uccb4 \uc0c1\uc18d\uc5d0 \uc758\ud55c \uc81c\ub124\ub9ad\\n\\n\uadf8\ub7f0 \uc758\ubbf8\uc5d0\uc11c \uc790\ubc14\ub294 \uae30\ubcf8\uc801\uc73c\ub85c `java.lang.Object` \ub97c \ubb35\uc2dc\uc801 \uc0c1\uc18d \ud558\ub2c8\uae4c \uadf8\ub0e5\\n\uc81c\ub124\ub9ad\uc774 \uac00\ub2a5\ud558\ub2e4\ub294 \uc598\uae30\uac00 \ub418\ub124\uc694.\\n```java\\nObject obj = new Integer(1);\\nSystem.out.println((Integer)obj + 1); // 2\\n```\\n\uc774\ub807\uac8c \uc288\ud37c\ud0c0\uc785 `Object` \uc5d0 \uc11c\ube0c\ud0c0\uc785 `Integer` \uac00 \ud560\ub2f9 \ub418\ub2c8\uae4c \uc774\ub7f0\uc2dd\uc73c\ub85c \uc4f0\uba74 \ub418\ub294 \uac70\uc8e0.\\n\\n\uc544, \uadfc\ub370. \uc800\uac74 \uc88b\uc740 \ubc29\uc2dd\uc740 \uc544\ub15c\uc694.\\n\\n1. \ucef4\ud30c\uc77c \uc2dc\uc810(\ud639\uc740 IDE \ub97c \uc774\uc6a9\ud574 \uc791\uc131\uc2dc\uc810)\uc5d0 \uc624\ub958 \uac80\ucd9c\uc774 \uc548\ub418\uace0\\n2. \ucf54\ub4dc\uc0c1\uc5d0\uc11c \uc2e4\uc81c \ub370\uc774\ud130\uc758 \ud0c0\uc785 \ud655\uc778\uc774 \uc548\ub418\uace0 (\ucea1\uc290\ud654 \ub418\uc5b4 \uc788\ub294 \ud544\ub4dc \uac19\uc740\uac78\ub85c \uac00\uc815\ud574\ubcf4\uba74 \ud0c0\uc785\uc740 `Object` \uc778\ub370 \ub370\uc774\ud130\ub294 `Integer` \uac00 \ub4e4\uc5b4\uac14\ub294\uc9c0 `String` \uc774 \ub4e4\uc5b4\uac00 \uc788\ub294\uc9c0...\ud83e\udd14)\\n3. \ud0c0\uc785 \uce90\uc2a4\ud305\uc744 \ud558\ub294\uac8c \ucf54\ub4dc\uac00 \ub9d8\uc5d0 \ub4e4\uc9c0 \uc54a\uc544\uc694.\\n\\n### \uc81c\ub124\ub9ad \ud45c\ud604\\n\\n\uadf8\ub798\uc11c JDK5 \ubd80\ud130 \uc81c\ub124\ub9ad \ud45c\ud604\uc744 \uc4f8 \uc218 \uc788\uac8c \ub418\uc5c8\ub124\uc694.\\n```java\\nList<Integer> list = new ArrayList<Integer>();\\nlist.add(1);\\nlist.add(\\"1\\"); // error!\\n...\\n```\\n\\n\\n> JDK7 \ubd80\ud130\ub294 \ud0c0\uc785\ucd94\ub860\uc774 \ub418\ub2c8\uae4c `new ArrayList<>()`  \uc774\ub807\uac8c\ub3c4 \uc791\uc131\ud560 \uc218 \uc788\uc8e0.\\n\\n`List` \uac00 \ub370\uc774\ud130\ub97c \ub2f4\ub294 \ub3d9\uadf8\ub780 \uc6d0\ud615\uc758 \ud1b5\uc870\ub9bc \ud1b5\uc774\ub77c \uac00\uc815\ud574\ubcf4\uba74, `List<Square>` \ub294 \ub124\ubaa8 \ubaa8\uc591\uc758 \ud1b5\uc774\ub77c\uace0 \uc0dd\uac01\ud558\uba74 \ub420 \uac83 \uac19\uc544\uc694.\\n\\n![](../static/files/20190510/generic.svg)\\n\\n\ub3d9\uadf8\ub77c\ubbf8\ub294 \uc6d0\ud615 \ud1b5\uc5d0\ub9cc \ub4e4\uc5b4\uac00\uace0, \ub124\ubaa8\ub294 \ub124\ubaa8\ub09c \ud1b5\uc5d0\ub9cc \ub4e4\uc5b4\uac00\ub294\uac70\uc8e0.\\n\\n### \uacb0\ub860\\n\\n\uc81c\ub124\ub9ad\uc744 \uc501\uc2dc\ub2e4!  \\n\ucf54\ub4dc\uc5d0\uc11c \ud0c0\uc785\uc744 \ucd94\ub860 \ud560 \uc218 \uc788\uace0, \ucef4\ud30c\uc77c \uc2dc\uc810\uc758 \uc624\ub958\ub97c \uc77c\ucc0d \uac80\ucd9c\ud574\uc11c Type safe \ud55c \ud504\ub85c\uadf8\ub798\ubc0d\uc744 \ud560 \uc218 \uc788\uac8c \ub3c4\uc640\uc8fc\ub2c8\uae4c\uc694."}]}')}}]);